.text
main:	lui $8, 0x1001 # desenhando o cenario
	lui $16, 0xffff
	addi $9, $8, 0
	addi $10, $0, 0
	addi $20, $0, 16384
ok:	beq $10, $20, npc
	lw $11, cenario($10)
	sw $11, 0($9)
	addi $9, $9, 4
	addi $10, $10, 4
	j ok
npc:	addi $9, $8, 8320 # missil
	addi $10, $0, 0xffffff
	addi $7, $0, 0xff0000
	sw $10, 0($9)
	addi $5, $0, 64
	addi $2, $0, 42
	syscall
	mul $4, $4, 4
	add $15, $4, $8
	addi $11, $0, 0
	addi $12, $0, 64
laco:	beq $11, $12, fim # personagem
	sw $7, 0($15)
	addi $14, $8, 14080
	bgt $15, $14, over
	addi $11, $11, 1
nada:	beq $5, 10000, jump # movendo o personagem
	lw $13, 0($16)
	beq $13, 0, go
	lw $13, 4($16)
	beq $13, 'q', fim
	beq $13, 'w', top
	beq $13, 's', bottom
	beq $13, 'a', left
	beq $13, 'd', right
	beq $13, 'e', shoot
	j go
top:	addi $14, $8, 256 # mover pra cima
	blt $9, $14, go
	sw $0, 0($9)
	addi $9, $9, -256
	sw $10, 0($9)
	j go
bottom:	addi $14, $8, 14080 # mover pra baixo
	bgt $9, $14, go
	sw $0, 0($9)
	addi $9, $9, 256
	sw $10, 0($9)
	j go
left:	addi $14, $8, 4 # mover pra esquerda
	blt $9, $14, go
	sw $0, 0($9)
	addi $9, $9, -4
	sw $10, 0($9)
	j go
right:	addi $14, $8, 14328 # mover pra direita
	bgt $9, $14, go
	sw $0, 0($9)
	addi $9, $9, 4
	sw $10, 0($9)
	j go
shoot:	addi $14, $9, -1040 # tiro
	addi $19, $0, 0
mat:	beq $19, 324, emplp
	lw $18, blast($19)
	sw $18, 0($14)
	addi $19, $19, 4
	addi $14, $14, 4
	addi $17, $17, 1
	bne $17, 9, jmat
	addi $14, $14, 220
	addi $17, $0, 0
jmat:	j mat
emplp:	beq $6, 10000, clear
	addi $6, $6, 1
	j emplp
clear:	addi $6, $0, 0
	addi $14, $9, -1040
	addi $19, $0, 0
mat2:	beq $19, 324, go
	sw $0, 0($14)
	addi $19, $19, 4
	addi $14, $14, 4
	addi $17, $17, 1
	bne $17, 9, jmat2
	addi $14, $14, 220
	addi $17, $0, 0
jmat2:	j mat2
go:	addi $5, $5, 1
	j nada
jump:	lw $5, 0($15)
	beq $5, 0x0, te
	addi $15, $15, 256
	addi $5, $0, 0
	j laco
te:	addi $9, $8, 0x0 # tela de fim de jogo (venceu)
	addi $10, $0, 0
	addi $20, $0, 16384
	addi $18, $0, 1
teok:	beq $10, $20, over
	lw $11, gameover($10)
	sw $11, 0($9)
	addi $9, $9, 4
	addi $10, $10, 4
	j teok
over:	jal clk		# piscando o cenario
	addi $6, $0, 0x0
	addi $7, $0, 0xff0000
	jal clr
	jal clk
	addi $6, $0, 0xff0000
	addi $7, $0, 0x0
	jal clr
	jal clk
	addi $6, $0, 0x0
	addi $7, $0, 0xff00
	jal clr
	jal clk
	addi $6, $0, 0xff00
	addi $7, $0, 0x0
	jal clr
	jal clk
	addi $6, $0, 0x0
	addi $7, $0, 0xff
	jal clr
	jal clk
	addi $6, $0, 0xff
	addi $7, $0, 0x0
	jal clr
pres:	lw $13, 0($16)	# reiniciar ou sair?
	beq $13, 0, pres
	lw $13, 4($16)
	beq $13, 'r', main
	beq $13, 'q', subs
