subs:	bne $18, 1, mov	# copia a tela de game over para o array do cenario
	addi $9, $8, 0x0
	addi $10, $0, 0
	addi $20, $0, 16384
subsok:	beq $10, $20, mov
	lw $11, gameover($10)
	sw $11, cenario($10)
	addi $9, $9, 4
	addi $10, $10, 4
	j subsok
mov:	addi $20, $0, 0	# move as inciais do programador na tela
	addi $6, $0, 0
movego:	beq $6, 50, fim
	jal clk
	jal erase
	addi $20, $20, 256
	jal cred
	addi $6, $6, 1
	j movego
fim:	addi $2, $0, 10
