clk:	sw $31, 0($29)	# clock
	sw $4, -4($29)
	addi $5, $0, 0
clkgo:	beq $5, 10000, clkend
	addi $5, $5, 1
	j clkgo
clkend:	lw $4, 4($29)
	lw $31, 0($29)
	jr $31
	
clr:	sw $31, 0($29)	# mudar de cor
	sw $4, -4($29)
	addi $9, $8, 0
	addi $10, $8, 16384
clrgo:	beq $9, $10, crlend
	lw $20, 0($9)
