	jr $31
	
erase:	addi $9, $8, 13220 # apaga iniciais
	sub $9, $9, $20
	addi $10, $0, 13220
	sub $10, $10, $20
	addi $11, $0, 0
	addi $12, $0, 18
ersgo:	beq $11, 180, erasef
	div $11, $12
	mfhi $14
	bne $14, 0, erasec
	addi $9, $9, 184
	addi $10, $10, 184
erasec:	lw $15, cenario($10)
	sw $15, 0($9)
	addi $9, $9, 4
	addi $10, $10, 4
	addi $11, $11, 1
